import React from 'react'
import "./Home__form.css"
import { useState, useEffect } from "react";


function Home__form() {
    const [Email , setEmail] = useState("");
    const [Password , setPassword] = useState("");
    const email_change = (event) => {
        setEmail(event.target.value) ;
        console.log(Email) ;
}
    const password_change = (event) => {
        setEmail(event.target.value) ;
        console.log(Email) ;
}
    return (
        <div>
            <form action="">
                <div className="form__email">
                    <input type="email" name="email" id="email" placeholder="Enter email" value={Email} onChange = {email_change}/>
                </div>
                <div className="form__password">
                    <input type="password" name="password" id="password" placeholder="Enter password" value={Password} onChange = {password_change}/>
                </div>
                <button type="submit" onSubmit>Login</button>
            </form>
        </div>
    )
}

export default Home__form
